  return (
    <React.Fragment>
      <div className="page-heading-container">
        <h1 className="page-heading">{heading}</h1>
      </div>

      <style jsx>{`
        .page-heading-container {
          width: 100%;
          height: 190px;
          background: #323636;
          display: flex;
          justify-content: center;
          align-items: center;
        }

        .page-heading {
          margin: 0 40px;
        }
      `}</style>
    </React.Fragment>
  );
};

export default PageHeading;
